// src/components/TodoList.js
import React from 'react';

const TodoList = ({ todos }) => {
  return (
    <div className="TodoListWrapper">
      <h2>Todo List</h2>
      <ul>
        {todos.map(todo => (
          <li key={todo.id}>
            {todo.title} - {todo.completed ? 'Completed' : 'Incomplete'}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default TodoList;
